function AdminPage() {
  return (
    <div className="App mx-[4%]">
      <div className="text-left w-[100%] text-gray-900 text-[25px] font-extrabold font-['Manrope'] leading-[37.50px]">
        Админ-панель
      </div>
      <div className="w-[425px] h-[47px] p-2.5 bg-white rounded-[10px] flex-col justify-start items-start gap-2.5 inline-flex">
        <div className="justify-start items-center gap-2 inline-flex">
          <div className="w-6 h-6 justify-center items-center flex">
            <div className="w-6 h-6 relative flex-col justify-start items-start flex"></div>
          </div>
          <div className="text-neutral-400 text-xl font-normal font-['Manrope']">
            Найти студента
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminPage;
